import { useState } from 'react';
import { TextField, MenuItem, Select, InputLabel, FormControl, Chip, Box } from '@mui/material';

function CreateProjectPage() {
  const [projectName, setProjectName] = useState('');
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [countries, setCountries] = useState([]);

  const availableCountries = ['Canada', 'USA', 'United Kingdom', 'Germany', 'France'];

  return (
    <div style={{ padding: '20px' }}>
      <h1>Create a New Project</h1>

      <form style={{ display: 'flex', flexDirection: 'column', gap: '16px', maxWidth: '500px' }}>
        
        <TextField
          label="Project Name"
          variant="outlined"
          value={projectName}
          onChange={(e) => setProjectName(e.target.value)}
          placeholder="Enter project name"
        />

        <TextField
          label="Start Date"
          type="date"
          InputLabelProps={{ shrink: true }}
          value={startDate}
          onChange={(e) => setStartDate(e.target.value)}
        />

        <TextField
          label="End Date"
          type="date"
          InputLabelProps={{ shrink: true }}
          value={endDate}
          onChange={(e) => setEndDate(e.target.value)}
        />

        <FormControl>
          <InputLabel>Countries</InputLabel>
          <Select
            multiple
            value={countries}
            onChange={(e) => setCountries(e.target.value)}
            renderValue={(selected) => (
              <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 0.5 }}>
                {selected.map((value) => (
                  <Chip key={value} label={value} />
                ))}
              </Box>
            )}
            style={{ width: '100%' }}
          >
            {availableCountries.map((country) => (
              <MenuItem key={country} value={country}>
                {country}
              </MenuItem>
            ))}
          </Select>
        </FormControl>

        <button type="submit">Save Project</button>

      </form>
    </div>
  );
}

export default CreateProjectPage;
